To see this, note that in Chomsky‐normal form every derivation from the start symbol S begins with one of these five binary rules:

  S → NT0  NT2  
  S → NT8  NT12  
  S → NT15  NT3  
  S → NT6  NT6  
  S → NT8  NT2  

Whatever choice you make, the first nonterminal on the right must derive the very first terminal of your target string, which is t296. But looking at all the terminal productions:

  • NT0 ⇒ {t42, t235, t283, t85, t188, t181, t108, t244}  
  • NT6 ⇒ {t28, t84, t245, t96, t24, t379, t286}  
  • NT8 ⇒ {t208, t195, t0}  
  • NT15 ⇒ {t175, t302, t201, t86, t364, t80, t360}  

none of NT0, NT6, NT8 or NT15 ever produces t296 directly. Thus no matter which S‐rule you pick, the left child cannot yield the initial t296, so the grammar cannot generate the given string.  

